import React from "react";

export default class Stateeg extends React.Component{

    constructor(){
        super()
        this.state={

            data:'JavaScript',
            version:18,
            sub:['evs','math','history'],
            obj:{
                uname:"pooja",
                pass:"pooja123"
            },
            products:[
                {pid:101,pname:"pooja"},
                {pid:102,pname:"shaurya"}
            ]


        }};

        render(){
            return(
                <div>
                    <p style={{color:'brown'}}>{this.state.data}</p>
                    <p style={{color:'blue'}}>{this.state.version}</p>
                    <p style={{color:'violet'}}>{this.state.sub}</p>
                    <p style={{color:'yellow'}}>{JSON.stringify(this.state.obj)}</p>
                    <p style={{color:'red'}}>{JSON.stringify(this.state.products)}</p>

                    <table className="table table-bordered table-primary table-striped table-hover w-50 max-auto">
                        <thead>
                            <tr>
                                <tr>srno</tr>
                                <th>pid</th>
                                <th>
                                    pname
                                </th>
                            </tr>
                        </thead>
                        <tbody>
                         {this.state.products.map((e,i)=>(
                            <tr>
                                <td>{i+1}</td>
                                <td>{e.pid}</td>
                                <td>{e.pname}</td>
                            </tr>
                         ))}
                        </tbody>
                    </table>
                </div>
            )
        
    }
}
